    <text class="ar" transform="translate(220.45 478.29) scale(.87 1)"><tspan class="bt"><tspan x="0" y="0">ببالغ الأسى والحزن وبقلوبٍ مؤمنة راضية بقضاء الله وقدره، تلقينا في </tspan></tspan><tspan class="bt"><tspan x="287.67" y="40.91">المحظرة خبر وفاة المغفور له بإذن الله تعالى</tspan></tspan><tspan class="bt"><tspan x="-27.35" y="245.46">تغمدها الله بواسع رحمته وأسكنها فسيح جناته. وبهذه المـناسبة الأليمة </tspan></tspan><tspan class="bt"><tspan x="90.18" y="286.38">نعزي باسم إدارة المحظرة وأسرَتها وطلابها وجميع العاملين بها</tspan></tspan><tspan class="bt"><tspan x="-20.91" y="490.93">وكافة أفراد الأسرة الكريمة دوحة المجد والعلم والفضل والـكرم، سائلين </tspan></tspan><tspan class="bt"><tspan x="12.95" y="531.84">المولى عز وجل أن يتغمد الفقيد بواسع رحمته ويســكنه فسيح جـناته </tspan></tspan><tspan class="bt"><tspan x="36.86" y="572.75">وينعم عليه بعفوه ورضوانه، ويلهم أهله وذويه الـصبر والسلـــــــوان. </tspan></tspan><tspan class="do"><tspan x="532.75" y="613.66">وإنا لله وإنا إليه راجعون</tspan></tspan><tspan class="bt"><tspan x="773.54" y="654.57" xml:space="preserve">   </tspan></tspan><tspan class="bt"><tspan x="259.81" y="695.48" xml:space="preserve">                                                                                </tspan></tspan><tspan class="bt"><tspan x="48.32" y="736.39" xml:space="preserve">بتاريـــخ :                                                                 امحمد أحمدو امباله</tspan></tspan></text>

<div class="b-group">
    <input type="text" id="nameIm" placeholder=" المعزى" dir="rtl">
    <input type="text" id="nameIv" placeholder="المعزى فيه " dir="rtl">
    <input type="date" id="nameDInput">
    <button onclick="updateSVG()">تحديــــــــث</button>
    <button id="saveButton">PNGحفظ كــــــــ</button>
    <button onclick="saveAsPDF()">PDFحفظ كـــــــــ</button>
</div>


<!-- Include jsPDF Library -->
<script src="../../js/jspdf.umd.min.js"></script>
<script src="../../js/html2canvas.min.js"></script>


<script>
    function updateSVG() {
        const name = document.getElementById("nameIm").value;
        const date = document.getElementById("nameDInput").value;
        const name_v = document.getElementById("nameIv").value;

        if (name) {
            document.getElementById("name-m").textContent = name;
        }
        if (date) {
            document.getElementById("text-date").textContent = date;
        }
        if (name_v) {
            document.getElementById("text-v").textContent = name_v;
        }

    }


    function saveAsPNG() {
      const element = document.getElementById("content");
      const name = document.getElementById("nameIm").value;

      if (!element) {
          console.error("Element not found!");
          return;
      }

      const scale = 2;
      const options = {
          scale: scale,
          logging: true,
          useCORS: true,
          allowTaint: true,
          letterRendering: true,
          backgroundColor: "#FFFFFF",
          windowWidth: element.scrollWidth,
          windowHeight: element.scrollHeight
      };

      html2canvas(element, options).then(canvas => {
          // Create HD PNG with maximum quality
          const link = document.createElement('a');
          link.download = name+'.png';
          link.href = canvas.toDataURL("image/png", 1.0); // 1.0 = maximum quality
          link.click();
      }).catch(error => {
          console.error("Error capturing content:", error);
          alert("Error capturing image: " + error.message);
      });
  }

  window.onload = function() {
      document.getElementById("saveButton").addEventListener("click", saveAsPNG);
  };

  function saveAsPDF() {
    const name = document.getElementById("nameIm").value;
    const element = document.getElementById("content");
    if (!element) {
        console.error("Element not found!");
        return;
    }

    // High quality settings
    const scale = 3;
    const dpi = 300; // Target DPI
    const options = {
        scale: scale,
        logging: true,
        useCORS: true,
        letterRendering: true,
        allowTaint: true,
        backgroundColor: "#FFFFFF"
    };

    html2canvas(element, options).then(canvas => {
        const imgData = canvas.toDataURL('image/png', 1.0);
        const pdf = new jspdf.jsPDF({
            orientation: canvas.width > canvas.height ? 'landscape' : 'portrait',
            unit: 'mm',
            format: [canvas.width * 0.264583, canvas.height * 0.264583], // px to mm
            compress: false,
            hotfixes: ["px_scaling"]
        });

        // Calculate dimensions in mm (1 inch = 25.4mm)
        const width = (canvas.width * 26.7) / dpi * scale;
        const height = (canvas.height * 26.7) / dpi * scale;

        // Add image to PDF
        pdf.addImage({
            imageData: imgData,
            format: 'PNG',
            x: 0,
            y: 0,
            width: width,
            height: height,
            compression: 'NONE'
        });

        pdf.save(name+'.pdf');
    }).catch(error => {
        console.error("Error generating PDF:", error);
        alert("Error generating PDF: " + error.message);
    });
  }


</script>
